import react from 'react'
import '../css/NavBar.css';

const InterMenu = () => {
    return(
        <div style={{height:"30px", width:"100%", backgroundColor:"white", display:"flex", justifyContent:"center"}}>
            <ul style={{display:"flex", flexDirection:"row", listStyle:"none", alignItems:"center"}}>
                <li>Özel</li>
                <li>Medya</li>
                <li>Hayranlar</li>
                <li>Paylaş</li>
            </ul>
        </div>
    )
}

export default InterMenu;
